import Avatar from '../image/avatar_autor.png'

const AutorCard = () => {
  return (
    <div className="autorCard">
      <div className="avatar">
        <img className="avatar" src={Avatar} alt="" />
      </div>
    </div>
  )
}

export default AutorCard
